import React from "react";
import MaximizableView from "./components/utils/fullscreen/MaximizableView";


function App() {
  return (
      <React.Fragment>
          <MaximizableView backgroundColor="#efefef">
            <div className="h1 padding-top">
              The reason developers avoid CSS
            </div>
          </MaximizableView>
      </React.Fragment>
  );
}

export default App;
